Slipping through the predawn darkness over highways, through traffic and across
the border, Palestinian construction workers go to work clandestinely in Israel
every day.

Haar's raw, handheld photography follows workers who build their own border
shanty community to enter Israel more easily, with no choice but to risk their
lives simply to earn a living.

